import Navbar from "../../components/Navbar"
import WorkSection from "../../components/WorkSection"

const Portfolio = (props) => {
    return(
        <>
        <Navbar />
        <div className="nav-margin-top"></div>
        <p>{props.url.pathname}</p>
        <WorkSection />
        </>
    )
}

export default Portfolio
